import React from 'react';

const Video = (props) => {
    console.log(props.video.url);
    return(
        <div className="col-12 col-sm-6 col-md-4 col-lg-3 mb-4">
            <div className="card">
                    <img src='${props.video.userImageUrl}' type="video/mp4"/>
            </div>
        </div>
    )
}

export default Video;
